import React, { Component } from 'react';

class PropertyPage extends Component {
	constructor() {
		super();
		this.state = {
			property: {}
		};
	}

	render() {
		const { property } = this.props;
		return (
			<div>
				<h1>Property Page</h1>
			</div>
		);
	}
}

export default PropertyPage;
